import { Container, Row, Col} from 'react-bootstrap';
import './TodoList.css';
import TodoItem from '../TodoItem/TodoItem';

function TodoList() {
    return (
        <Container fluid>
            <Row>
                <Col>
                    <div className='main'></div>
                </Col>
            </Row>
        </Container>
    );
}

export default TodoList;
